  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for James
  River National Wildlife Refuge outlines Refuge accomplishments during the 1994 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  the management plan and research and investigations. Refuge administration is outlined;
  information about personnel, volunteer programs, funding, and safety is given. Habitat
  management is also covered; subjects include wetlands, forests, and wilderness areas.
  The wildlife section of the report discusses wildlife diversity, endangered and
  threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
  game mammals, and fisheries resources. The public uses of the Refuge described in
  this report include outdoor classrooms, hunting, and outdoor recreation.\",\n\t\"owner_org\":
